    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Medicine Lake NWR Complex for the next 15 years.
    This plan outlines the Complex vision and purpose and describes how Medicine Lake
    NWR Complex will contribute to the overall mission of the Refuge System. The plan
    provides an introduction to the Complex, an overview of the CCP process, a summary
    of Complex resources, and information about the management direction. Key planning
    issues include: wildlife management, habitat management, partnerships, visitor services,
    water management, wilderness management, and operations.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
